import React from "react";
import { View, Text, TouchableOpacity } from "react-native";

//import style from "./style.js";

export default function Detalhes({navigation}) {
    return (
        <View>
            <TouchableOpacity>
                <Text>Tela Detalhes</Text>
            </TouchableOpacity>
        </View>
    )
}
